    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Rocky Flats NWR for the next 15 years. This plan
    outlines the Refuge vision and purpose and describes how Rocky Flats NWR will contribute
    to the overall mission of the Refuge System. The plan provides an introduction to
    the Refuge, an overview of the CCP process, alternatives, a description of the affected
    environment, environmental consequences, and consultation with others. Key planning
    issues include: vegetation management, wildlife management, public use, cultural
